Step-by-step reasoning:

1. Key Psychological Mechanisms:
 • The responder’s decision is influenced by the apparent fairness of the offer. Fairness can be evaluated by comparing the proposed share (split_self) to an expected fair share that is computed relative to each participant’s token contribution.
 • The expected fair share is assumed to be proportional to the participant’s contribution (token_self) out of the total tokens (token_self + token_opp) multiplied by the combined earning.
 • A lower-than-expected offer (split_self below fair share) decreases utility, whereas an offer exceeding the expected fair share increases utility.
 • An intercept (bias) is also allowed to capture any baseline tendency to accept or reject.

2. How these mechanisms interact:
 • The difference between the actual offer (split_self) and the fair share (combined_earning * [token_self/(token_self + token_opp)]) is calculated.
 • This difference is scaled by a fairness sensitivity parameter (beta_f). Higher sensitivity implies that deviations below fairness induce stronger negative utility.
 • A base intercept (beta0) is added to capture systematic accept/reject bias.
 • The overall utility U is then transformed via a logistic function to produce the probability of accepting the proposal.

3. Mathematical form:
 • Utility: U = beta0 + beta_f * (split_self – (combined_earning * token_self/(token_self+token_opp)))
 • Decision probability: P(accept) = 1/(1+exp(–U))
 • The binary accept outcome is predicted based on this probability.

4. Parameters needed:
 • beta0 (intercept) and beta_f (fairness sensitivity) are learnable parameters with finite, generously wide bounds.
  – beta0 is bounded in [–10, 10]
  – beta_f is bounded in [0, 20]

5. Mapping to observable behavior:
 • The model uses observable variables split_self, combined_earning, token_self, and token_opp.
 • It predicts the accept decision (target variable) by computing a utility and then mapping that utility to an accept probability with a logistic function.

Below is the formal model specification and variable descriptions.

